import './App.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./pages/Home";



function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<h1>Home</h1>} />
      <Route path="/products" element={<h1>Products</h1>} />
      <Route path="/cart" element={<h1>Cart</h1>} />
    </Routes>
    </BrowserRouter>
  );
}

export default App;
